import s from './MyPosts.module.css';
import Post from './Post/Post'

const Posts = (props) => {
    let PostsData = [ {id: p1, text: "Oh, I was not made for heaven. No, I don't want to go to heaven. Hell is much better. Think of all the interesting people you're going to meet down there!"}

    ]
}

const MyPosts = (props) => {
    return (
    <div>
        <h1> My posts </h1>
        <div className={s.input}>
            <div className={s.field}>
                <div>
                    <form method='post' action='/'>
                        <input type='text' name='name' id='name'/>
                    </form>
                    <button><a href='#'>Send</a></button>
                </div>
            </div>
            <div className={s.noDiv}></div>
        </div>

        <div className={s.posts}>
            <Post text="Oh, I was not made for heaven. No, I don't want to go to heaven. Hell is much better. Think of all the interesting people you're going to meet down there!"/>
            <Post text="The reason we're successful, darling? My overall charisma, of course."/>
            <Post text="I am a romantic, but I do put up a barrier around myself, so it is hard for people to get in and to know the real me."/>
        </div>
    </div>
    )
}

export default MyPosts;
